//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.8; 

import '../node_modules/@openzeppelin/contracts/utils/math/SafeMath.sol';

import '../node_modules/@openzeppelin/contracts/token/ERC20/ERC20.sol';

import '../node_modules/@openzeppelin/contracts/access/AccessControl.sol';
import '../node_modules/@openzeppelin/contracts/security/ReentrancyGuard.sol'; // OZ contracts v4

/**
* @notice Stakeable is a contract who is ment to be inherited by other contract that wants Staking capabilities
*/
contract DreStake is AccessControl, ReentrancyGuard {
    using SafeMath for uint256;

    uint48 public constant MAX_TIME = type(uint48).max; // = 2^48 - 1

    uint256 public tokenTotalStaked = 0; // sum of all staked tokens
    ERC20 public stakingToken;     /*Token address */
    uint48 public startTimestamp;
    uint48 public endTimestamp;
    uint48 public lockTimestamp = 60 days;
    uint8 public lockPercent;

    constructor(address _stakingToken, uint48 _startTime, uint48 _endTime, uint48 _lockTime, uint8 _lockPercent) {
        require(_startTime > block.timestamp, "StartTime must occur in future");
        require(_startTime < _endTime, "StartTime must occur before EndTime");
        require(_stakingToken != address(0), "stakingToken.address == 0");
        require(_lockTime < 366 days, "lockTime >= 366 days");
        require(_lockPercent > 0, "lockPercent <= 0");
        require(_lockPercent <= 100, "lockPercent > 100");
        stakingToken = ERC20(_stakingToken);
        startTimestamp = _startTime;
        endTimestamp = _endTime;
        lockTimestamp = _lockTime;
        lockPercent = _lockPercent;
        // set some defaults
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    /**
     * based on OpenZeppelin SafeCast v4.3
     * https://github.com/OpenZeppelin/openzeppelin-contracts/blob/release-v4.3/contracts/utils/math/SafeCast.sol
     */

    function toUint48(uint256 value) internal pure returns (uint48) {
        require(value <= type(uint48).max, "value doesn't fit in 48 bits");
        return uint48(value);
    }

    function toUint160(uint256 value) internal pure returns (uint160) {
        require(value <= type(uint160).max, "value doesn't fit in 160 bits");
        return uint160(value);
    }


    
    /**
     * @notice
     * A stake struct is used to represent the way we store stakes, 
     * A Stake will contain the users address, the amount staked and a timestamp, 
     * Since which is when the stake was made
     */
    struct Stake{
        address user;
        uint256 amount;
        uint256 point;
        uint256 maxPoint;
        uint48 lastCalculatedTimestamp;
        uint8 isLocked;
    }

    /**
    * @notice 
    * stakes is used to keep track of the INDEX for the stakers in the stakes array
     */
    mapping(address => Stake) public stakes;
    address[] stakers;
    /**
    * @notice Staked event is triggered whenever a user stakes tokens, address is indexed to make it filterable
     */
    event Staked(address indexed user, uint256 amount, uint256 date);
    event Withdraw(address indexed wallet, uint256 amount, uint256 date);
    event LockTimeChanged(uint48 lockTime);
    event ERC20TokensRemoved(address indexed tokenAddress, address indexed receiver, uint256 amount);

    /**
     * Modifier
     */
    modifier onlyStaker(address _wallet) {
        require(stakes[_wallet].user == _wallet, "You are not a staker");
        _;
    }

    /**
     * External API functions
     */

    function stakePoint(address _staker) external view returns (uint256) {
        return stakes[_staker].point;
    }

    function stakeAmount(address _staker) external view returns (uint256) {
        return stakes[_staker].amount;
    }

    // redundant with amount() for compatibility
    function balanceOf(address _staker) external view returns (uint256) {
        return stakes[_staker].amount;
    }

    // onlyOwner / DEFAULT_ADMIN_ROLE functions --------------------------------------------------
    /**
     * @notice set time a user has to wait after calling unlock until staked token can be withdrawn
     * @param _lockTime time in seconds
     */
    function setLockTimestamp(uint48 _lockTime) external onlyRole(DEFAULT_ADMIN_ROLE) {
        lockTimestamp = _lockTime;
        emit LockTimeChanged(_lockTime);
    }

    function unlock(address[] memory _wallets) external onlyRole(DEFAULT_ADMIN_ROLE) {
        require(block.timestamp > endTimestamp, "Stake period must be ended");
        for(uint i = 0; i < _wallets.length; i++) {
            Stake storage user = stakes[_wallets[i]];
            user.isLocked = 0;
        }
    }

    /**
     * @dev return unix epoch time when staked tokens will be unlocked
     * @dev return MAX_INT_UINT48 = 2**48-1 if user has no token staked
     * @dev this always allows an easy check with : require(block.timestamp > getUnlockTime(account));
     * @return unlockTime unix epoch time in seconds
     */
    function getUnlockTime() public view returns (uint48) {
        return endTimestamp + lockTimestamp;
    }

    /**
     * @return An address list of all stakers
     */
    function getAllStakers() public view returns (address[] memory) {
        return stakers;
    }

    /**
     * @return Current accumulated point of staker
     */
    function getPoint(address _staker) public view returns (uint256) {
        uint time = (endTimestamp > block.timestamp) ? block.timestamp : endTimestamp;
        Stake storage staker = stakes[_staker];
        if (staker.point == staker.maxPoint || staker.lastCalculatedTimestamp == time) return staker.point;
        else {
            uint256 currentPoint = staker.point + (time - staker.lastCalculatedTimestamp) / 3600 * (staker.amount / 1000000000000000000);
            if (currentPoint > staker.maxPoint) {
                return staker.maxPoint;
            } else {
                return currentPoint;
            }
        }
    }

    function amount_canWithdraw(address _wallet) public view returns (uint256) {
        uint current = block.timestamp;
        Stake storage user = stakes[_wallet];
        if (user.user != _wallet) {
            return 0;
        } else if (current < endTimestamp || current - endTimestamp > lockTimestamp || user.isLocked == 0) {
            return user.amount;
        } else {
            return user.amount / 100 * (100 - lockPercent);
        }
    }

    /** msg.sender external view convenience functions *********************************/

    function stakeAmount_msgSender() public onlyStaker(msg.sender) view returns (uint256) {
        return stakes[msg.sender].amount;
    }

    function stakePoint_msgSender() public onlyStaker(msg.sender) view returns(uint256) {
        return getPoint(msg.sender);
    }

    function amount_canWithdraw_msgSender() public onlyStaker(msg.sender) view returns(uint256) {
        return amount_canWithdraw(msg.sender);
    }

    /**
     * add stake token to staking pool
     * @dev requires the token to be approved for transfer
     * @dev we assume that (our) stake token is not malicious, so no special checks
     * @param _amount of token to be staked
     */
    function _stake(uint256 _amount) internal returns (uint256) {
        require(_amount > 0, "stake amount must be > 0");

        uint48 current = toUint48(block.timestamp);

        require(current >= startTimestamp, "Staking period has not started yet");
        require(current < endTimestamp, "Staking period has been ended");
        require(stakingToken.transferFrom(msg.sender, address(this), _amount), "erc20 worked failed");

        Stake storage user = stakes[msg.sender];
        if (user.user != msg.sender) {
            stakers.push(msg.sender);
            stakes[msg.sender].user = msg.sender;
            stakes[msg.sender].isLocked = 1;
        }

        uint newPoint = user.point + ((current - user.lastCalculatedTimestamp) / 3600) * (user.amount / 1000000000000000000);
        user.lastCalculatedTimestamp = current;
        user.amount = toUint160(user.amount + _amount);
        user.maxPoint = ((endTimestamp - startTimestamp) / 3600) * (user.amount / 1000000000000000000);
        if (newPoint > user.maxPoint) {
            user.point = user.maxPoint;
        } else {
            user.point = newPoint;
        }

        tokenTotalStaked += _amount;

        emit Staked(msg.sender, _amount, toUint48(block.timestamp)); // = user.stakeTime
        return _amount;
    }

     /**
     * withdraw staked token, ...
     * do not withdraw rewards token (it might not be worth the gas)
     * @return amount of tokens sent to user's account
     */
    function _withdraw(uint256 _amount) internal returns (uint256) {
        require(_amount > 0, "withdraw amount < 0");
        Stake storage user = stakes[msg.sender]; // update rewards and return reference to user

        require(_amount <= amount_canWithdraw_msgSender(), "Can not withdraw more than you can");

        uint current = block.timestamp;

        user.amount -= toUint160(_amount);
        tokenTotalStaked -= _amount;
        
        if (current <= endTimestamp) {
            user.maxPoint = ((endTimestamp - startTimestamp) / 3600) * (user.amount / 1000000000000000000);
            if (user.point > user.maxPoint) {
                user.point = user.maxPoint;
            }
        }
        // using SafeERC20 for IERC20 => will revert in case of error
        require(stakingToken.transfer(msg.sender, _amount), "ERC20 worked failed");

        emit Withdraw(msg.sender, _amount, toUint48(block.timestamp)); // = user.stakeTime
        return _amount;
    }

    function stake(uint256 _amount) external nonReentrant returns (uint256) {
        return _stake(_amount);
    }

    function withdraw(uint256 _amount) external nonReentrant returns (uint256) {
        return _withdraw(_amount);
    }

    function withdrawAll() external nonReentrant returns (uint256) {
        return _withdraw(amount_canWithdraw_msgSender());
    }

     /**
     * Do not accept accidently sent ETH :
     * If neither a receive Ether nor a payable fallback function is present,
     * the contract cannot receive Ether through regular transactions and throws an exception.
     * https://docs.soliditylang.org/en/v0.8.7/contracts.html#receive-ether-function
     */

    /**
     * @notice withdraw accidently sent ERC20 tokens
     * @param _tokenAddress address of token to withdraw
     */
    function removeOtherERC20Tokens(address _tokenAddress) external onlyRole(DEFAULT_ADMIN_ROLE) {
        require(_tokenAddress != address(stakingToken), "can not withdraw staking token");


        ERC20 otherToken = ERC20(_tokenAddress);
        uint256 balance = otherToken.balanceOf(_tokenAddress);

        require(otherToken.transfer(msg.sender, balance), "erc20 worked failed");
        emit ERC20TokensRemoved(_tokenAddress, msg.sender, balance);
    }

}

